import {React,useContext} from 'react';
import { GlobalConter } from './Page1';
export default function Page3() {
    const conter=useContext(GlobalConter)
  return (
    <div className='mt-5'>
          
        {/* <h1>{panais}</h1> */}
        <div className='container'>
            <div className="row">
                <div className="col-lg-3">
                <div className="card" >
            
               <div className="card-body">
                 <h5 className="card-title">iphone 14</h5>
                 <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                 <button href="#" className="btn btn-primary" onClick={conter}>add to card </button>
               </div>
                </div>
                </div>

                <div className="col-lg-3">
                <div className="card" >
             
               <div className="card-body">
                 <h5 className="card-title">Realme C35</h5>
                 <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                 <button href="#" className="btn btn-primary"  onClick={conter}>add to card </button>
               </div>
                </div>
                </div>

                <div className="col-lg-3">
                <div className="card" >
              
               <div className="card-body">
                 <h5 className="card-title">remdi note 11pro</h5>
                 <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                 <button href="#" className="btn btn-primary"  onClick={conter}>Gadd to card </button>
               </div>
                </div>
                </div>

                <div className="col-lg-3">
                <div className="card" >
             
               <div className="card-body">
                 <h5 className="card-title">samsung A53</h5>
                 <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                 <button href="#" className="btn btn-primary"  onClick={conter}>add to card </button>
               </div>
                </div>
                </div>
            </div>
        </div>
  
    </div>
  )
}
